 z+="The CallBack function is a JavaScript only function that allows pausing the program execution until the call back is executed.<br><br>In this example we use the jQuery symbol ($) to call the hide() function. &nbsp;The hide function has one call back as the second parameter. &nbsp;In this postition we place the marker \"CallBack\". &nbsp;If the function doing the call back passes parameters, we can place them in the marker, as in \"CallBack(p1, p2 ,3)\". &nbsp;We execution resumes after the callback, the parameters specified are avaliable to your application.<br><br>If you are calling a JavaScript function which has multiple possible call backs, you can place multiple markers in your code. &nbsp;When program execute resumes, the variable \"CallBackNumber\" is set to the corresponding marker (1..n)&nbsp;<br><br>\xFE";
 z+="<br>\xFE";
 z+="<div class=\"docExample\">&nbsp;&nbsp;&nbsp;&nbsp;If&nbsp;System(1)&nbsp;<>&nbsp;\"js\"&nbsp;Then&nbsp;Stop&nbsp;\"This&nbsp;is&nbsp;a&nbsp;JavaScript&nbsp;only&nbsp;example\"\xFE";
 z+="<br>\xFE";
 z+="<br>*$options&nbsp;js\xFE";
 z+="<br>*\xFE";
 z+="<br>*&nbsp;Display&nbsp;an&nbsp;object&nbsp;out&nbsp;(picID)\xFE";
 z+="<br>*\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;Print&nbsp;Image('picID',&nbsp;@jsbRoot():'pics/run.png',&nbsp;'',&nbsp;'',&nbsp;'')\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;@Server.Flush\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;Sleep&nbsp;2\xFE";
 z+="<br>*\xFE";
 z+="<br>*&nbsp;Hide&nbsp;the&nbsp;picture&nbsp;slowly\xFE";
 z+="<br>*\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;$('#picID').hide(\"slow\",&nbsp;CallBack())\xFE";
 z+="<br>*\xFE";
 z+="<br>*&nbsp;after&nbsp;the&nbsp;pic&nbsp;is&nbsp;hidden,&nbsp;the&nbsp;CallBack()&nbsp;in&nbsp;the&nbsp;parameter&nbsp;list&nbsp;causes&nbsp;continuation.\xFE";
 z+="<br>*&nbsp;The&nbsp;variable&nbsp;CallBackNumber&nbsp;is&nbsp;set&nbsp;to&nbsp;1,&nbsp;as&nbsp;there&nbsp;is&nbsp;only&nbsp;one&nbsp;CallBack&nbsp;for&nbsp;this&nbsp;function.\xFE";
