var z="* Category: BASIC Language|Structures Classes<br><br>\xFE";
 z+="\xFE";
 z+="JSB classes are simple in structure. &nbsp;They are simply a JSON data structure and a naming convention.<br><br>When you declare a class, as in the example below, class c1, the compiler prefixes each subroutine and function in the class with the class name. &nbsp;So, for example, function F1 really becomes function c1_F1, subroutine t1 becomes sub c1_t1, etc. &nbsp;The other modification the compiler makes is to insert the parameter ME at the beginning of each subroutine and function. &nbsp;So again, in the example below, function F1(p1) becomes function c1_F1(ME, p1). &nbsp;The Me parameter is automatically passed in the call. &nbsp;As in the case of the call t.t1('test'), this becomes call c1_t1(t, 'test'). &nbsp;This exposes the JSON structure (t) to the functions in the class.<br><br>The one short coming of this class implementation is the class methods can only be invoked directly from a class object. &nbsp;So, call t.t1('test') is legal syntax (t is the object, and t1 is the method), but call a.b.c('x') is not legal (The method c is too far nested in syntax). &nbsp;You can correct this by doing something like o = a.b; call o.c('test'); &nbsp;This moves the call to the upper most object.method() syntax. &nbsp;Likewise, something like call array[1].method() must become obj = array[1]; call obj.method(). &nbsp;The reason for this is that the compiler and runtime need to check the method being called and determine if this is a valid JSB object or an intensic system call. &nbsp;Anything past the first call is assumed to be a system object call.<br><br>This caveat is only necessary for JSB created objects. &nbsp;If you are using intensic objects, like $response, or $('jquery'), this requirement of moving the call to the top level isn't required, and something like $application['var'].method(p) is valid syntax.<br><br>Also, with JSB created objects, methods, and class variables, they are case insensitive, and call t.f1, call T.F1, are both valid. &nbsp;(This isn't true for internsic sytem objects which are case sensitive. &nbsp;With $Response.write(x), the \"write\" must be lower case for the response object).<br><br><div style=\"text-align: justify;\"><span style=\"color: inherit; font-size: 4mm;\"><i><u>Special considerations for the JavaScript version of JSB:</u></i></span></div><br>With the JavaScript version of JSB, it is sometime advantageous to call JavaScript object.methods, such as window.focus(). &nbsp;This works, as \"window\" and \"$\" are predeclared by the compiler and recognized as valid javascript objects. &nbsp;However, if you want to call something like Math.random(), you need to declare \"Math\" as an external object, as in \"* $options external Math\" ( &nbsp;Note that the case is sensitive). &nbsp;This let's the compiler know that \"Math\" is a valid JavaScript object that is already predeclared.<br><br>Also, sometimes you may end up with a JavaScript object that is a return value from a function, as in \"doc = window.document\" . &nbsp;If you were to invoke \"doc.write(x)\" it would fail, as the JSB compiler would assume that \"doc\" is a JSB object, not a JavaScript Object. &nbsp;To make the compiler treat \"doc\" as a valid JavaScript object, use \"* $options javascript doc\". &nbsp;<br><br><br>\xFE";
 z+="<br>\xFE";
 z+="<div class=\"docExample\">&nbsp;&nbsp;&nbsp;&nbsp;T&nbsp;=&nbsp;New&nbsp;C1\xFE";
