var z="\xFE";
 z+="* Category: Terminal Command Line (TCL)|Commands<br>\xFE";
 z+="<br>\xFE";
 z+="The TCL CATALOG command will create an MD entry for the given program. &nbsp;(Normally, JSB software defined in a PROGRAM statement will catalog an MD entry automatically when doing the compile. ) &nbsp; The CATALOG command allows cataloging without having to compile.<br><br>Example: CATALOG JSB_TCL WHO<br><br>will create the MD entry that enables running the WHO program from TCL. &nbsp;Note, that any cataloged program can be run by any user in that MD account. &nbsp;So, check for correct user privileges at that start of your program.<br><br><br><br><div class=\"docExample\">&nbsp;&nbsp;&nbsp;&nbsp;TCL>&nbsp;CATALOG&nbsp;TCL&nbsp;XTD&nbsp;\xFE";
 z+="<br>\xFE";
