 z+="<br>\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;Print&nbsp;X<br><input type=\"button\" class=\"docExampleClick\" value=\"Click here to run this example\" onclick=\"javascript: popoutWindow(&quot;help example&quot;, &quot;?showExample example_transactions&quot;, &quot;80%&quot;, &quot;80%&quot;, false);\"></div ><br><br><br><br><div class=\"docExample\">&nbsp;&nbsp;&nbsp;&nbsp;*$options&nbsp;aspx\xFE";
 z+="<br>\xFE";
