 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;Readu&nbsp;X1&nbsp;From&nbsp;@fHandle(\"STMP\"),&nbsp;\"Counter1\"&nbsp;Else&nbsp;X1&nbsp;=&nbsp;0\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;Readu&nbsp;X1&nbsp;From&nbsp;@fHandle(\"STMP\"),&nbsp;\"Counter2\"&nbsp;Else&nbsp;X2&nbsp;=&nbsp;0\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;X1&nbsp;=&nbsp;Val(X1)&nbsp;+&nbsp;1\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;X2&nbsp;=&nbsp;Val(X2)&nbsp;+&nbsp;1\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;Begin&nbsp;Transaction\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp;Both&nbsp;Writes&nbsp;must&nbsp;succeed&nbsp;or&nbsp;the&nbsp;Transaction&nbsp;will&nbsp;fail\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Write&nbsp;X1&nbsp;On&nbsp;@fHandle(\"STMP\"),&nbsp;\"Counter1\"&nbsp;Else&nbsp;Goto&nbsp;Failed\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Write&nbsp;X2&nbsp;On&nbsp;@fHandle(\"STMP\"),&nbsp;\"Counter2\"&nbsp;Else&nbsp;Goto&nbsp;Failed\xFE";
 z+="<br>&nbsp;&nbsp;&nbsp;&nbsp;End&nbsp;Transaction&nbsp;Else&nbsp;Goto&nbsp;Failed\xFE";
