 z+="<br>\xFE";
 z+="<br>Failed:&nbsp;Stop&nbsp;\"Failed&nbsp;\":@Errors<br><input type=\"button\" class=\"docExampleClick\" value=\"Click here to run this example\" onclick=\"javascript: popoutWindow(&quot;help example&quot;, &quot;?showExample example_transactions_2&quot;, &quot;80%&quot;, &quot;80%&quot;, false);\"></div ><br><br><br><br>"
