window.cached_jsb_docs["turn json into a string with cstr.htm"]="* Category: BASIC Language|Structures JSON<br><br>\xFE\xFE<br />\xFE<br />\xFETurn JSON into a string with CSTR<br />\xFE<br />\xFE<div class=\"docExample\">&nbsp;&nbsp;&nbsp;&nbsp;A&nbsp;=&nbsp;{h1:'hi',&nbsp;r1:&nbsp;'here',&nbsp;o1:&nbsp;'ok'}\xFE<br>&nbsp;&nbsp;&nbsp;&nbsp;C&nbsp;=&nbsp;CStr(A)&nbsp;;*&nbsp;Turns&nbsp;It&nbsp;Into&nbsp;A&nbsp;String\xFE<br>&nbsp;&nbsp;&nbsp;&nbsp;Print&nbsp;C<br><input type=\"button\" class=\"docExampleClick\" value=\"Click here to run this example\" onclick=\"javascript: popoutWindow(&quot;help example&quot;, &quot;?showExample example_turn_json_into_a_string_with_cstr&quot;, &quot;80%&quot;, &quot;80%&quot;, false);\"></div ><br><br><br><br>";
var z="\xFE";
 z+="  \xFE";
 z+="  * Category: Tutorial|Concepts|01 Database Files Items<br><br>\xFE";
 z+="<h4 style=\"text-align: right;\">\xFE";
 z+="   <font face=\"times new roman\">\xFE";
 z+="      <div style=\"text-align: center;\">\xFE";
 z+="         <font size=\"5\" style=\"color: rgb(51, 51, 51); line-height: 1.1;\">Database Concepts and Definitions<br></font><br>\xFE";
 z+="         <div style=\"color: rgb(51, 51, 51); text-align: left;\"><font size=\"3\"><span style=\"line-height: 1.1;\">JSB is modeled after the&nbsp;</span><a href=\"https://www.google.com/search?q=mvdbms&amp;oq=mvdbms&amp;aqs=chrome..69i57j69i65l2j0.1391j0j7&amp;sourceid=chrome&amp;ie=UTF-8\" title=\"MVDBMS\" target=\"\" style=\"line-height: 1.1;\">MVDBMS</a><span style=\"line-height: 1.1;\">&nbsp;operating system (Multi-Value Database Management System). &nbsp;</span></font><span style=\"font-size: medium; line-height: 1.1;\">In concept, a MVDBMS is an&nbsp;implementation of 3 standard systems, a BASIC compiler, a relational database system, and a terminal command language (TCL). &nbsp;JSB's implementation of these three systems is unique and does not completely implement the R83 standard. &nbsp;However, JSB has many modern extensions that the original 1983 (R83) release didn't have. &nbsp;These extensions bring an object&nbsp;oriented</span><span style=\"line-height: 1.1;\"><font size=\"3\">&nbsp;programming ability to the BASIC compiler, the&nbsp;addition of HTML input and output, and JSON data formats and interchange.<br><i><br></i></font><i>NOTE: &nbsp;</i><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><i>A PDF from Jonathan E. Sisk is available on the R83 implementation at</i>&nbsp;</span><a href=\"http://www.jes.com/pb/pbapg.pdf\" title=\"Pick Basic Programmer's Guide\" target=\"\" style=\"background-color: rgb(255, 255, 255); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Pick Basic Programmer's Guide</a><br><br><b><font size=\"4\">Database</font></b></span></div >\xFE";
 z+="         <div style=\"text-align: left;\"><font size=\"3\" style=\"color: rgb(51, 51, 51);\"><br><span style=\"line-height: 1.1;\">In the heart of the&nbsp;</span></font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">MVDBMS&nbsp;system&nbsp;</span><font size=\"3\"><span style=\"color: rgb(51, 51, 51); line-height: 1.1;\">is the database. &nbsp;It is&nbsp;</span>similar<span style=\"line-height: 1.1;\">&nbsp;to that of a SQL database in that it contains tables, rows and columns. &nbsp;Although, in the original&nbsp;</span></font><span style=\"font-size: medium; line-height: 17.6px;\">MVDBMS</span><font size=\"3\"><span style=\"line-height: 17.6px;\">&nbsp;</span></font><font size=\"3\"><span style=\"line-height: 1.1;\">different terminology&nbsp;was used, I have adopted the more modern and current terminology where applicable. &nbsp;Beyond the concept of tables, rows, and columns, an MVDBM also contains multi-values and multi-sub-values. &nbsp; In the original MVDBMS the database and the user's account were one and the same. &nbsp;I have extended this, and the two in this implementation my be a single database, or two different databases. &nbsp;In essence, an account is where the Master Definitions and software programs reside, and the database is where the rest of the data tables reside. &nbsp;The Account and the Database may be one and the same, but this requirement isn't necessary.<br><br>The unique aspect of an&nbsp;</span></font><span style=\"font-size: medium; line-height: 17.6px;\">MVDBMS</span><span style=\"font-size: medium; line-height: 17.6px;\">&nbsp;</span><font size=\"3\"><span style=\"line-height: 1.1;\">database is that beyond columns, each field of a row may contain nested fields (value fields), and these value fields may contain nested fields (called sub-value fields). &nbsp;While this type of nesting isn't required, and you may write programs which don't use this aspect of an MVDBMS system, you will eventually determine that this type of multi-valued field has it's advantages and disadvantages. &nbsp;<br><br></span></font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">In the older&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">MVDBMS</span><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">&nbsp;terminology a table was called a file, and a row was called an item, and a column was called an attribute. &nbsp;I have abandoned these definitions and adopted the more modern terminology of tables, rows and columns. &nbsp;However, a significant difference is that an MVDBMS system originally have numbered columns, not column names. &nbsp;The JSB implementation allows either or both. &nbsp;(In essence, the column ordinal placement is used when referencing a column by number).<br><br></span><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">In much of the standard JSB libraries you will see routines the operate on \"files\" or mention \"items\" or \"attributes\". &nbsp;Just replace this nomenclature with \"tables\", \"rows\" and \"columns\" if you see this. &nbsp;I just haven't changed all the comments and descriptions yet in the libraries to the newer names.<br><br><b>The Active Account</b><br>The active account is a database, and is determined by the file path or URL which started JSB. &nbsp;You may not change the active account unless you navigate to a different URL or stop the JSB system and restart it from another file path. &nbsp;The configuration tables (MD, JSB_CONFIG, and SYSTEM) reside in the Active Account.<br><br><b>The Attached Database</b><br>The attached database, by default is the active account. &nbsp;So that, when you attempt to query a table or create a new table, by default these actions will run against the active account. &nbsp;However, this may not normally be the case, as you may have a database on your network which houses you application tables. &nbsp;Thus, to change these actions to preform against a different database you \"ATTACH\" to the other database. &nbsp;You may do this either through the command prompt (TCL ATTACH) or via the JSB Basic statement ATTACHDB. &nbsp;Once attached, TCL commands and JSB Basic database commands will attempt to be preformed on the attached database. &nbsp;If the command begin preformed can't find a table in the default database, if will try a 2nd time against the active account. &nbsp; In addition, and standard JSB tables always reside in the active account, and even when you are attached to another database, operations preformed on the JSB tables will always perform on the active account.<br><br></span></div ><div style=\"text-align: left;\"><font size=\"3\"><span style=\"line-height: 17.6px;\"><b style=\"color: rgb(51, 51, 51);\">Multiple Databases</b><br><br>An MVDBMS system has a unique table called the&nbsp;<i style=\"color: rgb(51, 51, 51);\">SYSTEM&nbsp;</i>table. &nbsp;It resides in the active account database in the table SYSTEM. &nbsp;The SYSTEM table is used to store information about all the other databases and accounts accessible&nbsp;from the active account. &nbsp;This allows tables from other databases to appear as though they are a part of the current attached database. &nbsp;Thus, it is possible to have tables in the active account, the attached database, and any other database for which the correct configuation has been setup. &nbsp;One of the beautiful things about this type of configuration&nbsp;is that a table may reside just about anywhere, and to the application which is running, it doesn't care. &nbsp;No special computer code has to be written to access tables other than setting up the configuration&nbsp;files. &nbsp;Thus, I can have a table on the local file system, or on a network SQL server, or on the internet on DROPBOX of Google Drive. &nbsp;To my application program, I simple open the table, and the under lying JSB system and configuration&nbsp;files make the table appear the same to my application.<br><br></span></font></div ><div style=\"text-align: left;\"><font size=\"4\" style=\"color: rgb(51, 51, 51);\"><b>Security</b></font><br><br><font size=\"3\"><span style=\"line-height: 17.6px;\">A user or application \"logs-in\" to the active JSB account and from this vantage point, the application or user can then see items in the active account. &nbsp;Other files and items from other accounts may be defined via \"Q-Pointers\". &nbsp; In short a user has no privileges&nbsp;to access any data, but an application has all access to the data in the account to which he is logged into. &nbsp;Thus, it becomes the responsibility of the application to check for proper permissions. &nbsp;(Note that some databases and file systems limit access via their own methods).&nbsp;<br></span></font><br><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">A&nbsp;fundamental&nbsp;design of JSB is that programs run with administrative&nbsp;</span><font size=\"3\" style=\"color: rgb(51, 51, 51);\">privileges</font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">. &nbsp; That is, a program running in an account called \"XYZ\" has full CRUD&nbsp;</span><font size=\"3\" style=\"color: rgb(51, 51, 51);\">privileges</font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">&nbsp;to all files created in and owned by account \"XYZ\". &nbsp;(Other MVDBMS files (tables) defined in other accounts may or may not be&nbsp;</span><font size=\"3\" style=\"color: rgb(51, 51, 51);\">accessible</font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">&nbsp;to programs running in account \"XYZ\", depending on how the connection strings to those other accounts are defined in the system account.) &nbsp;&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">A standard user at the command prompt (TCL) does not have the ability to execute any commands other that those you define and the one defined in the JSB_TCL file. &nbsp;A standard user can only execute programs that are&nbsp;</span><i style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">cataloged</i><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">. &nbsp;Thus if one removed all the cataloged entries in the master dictionary of the account, there would be no operations a user could preform. &nbsp;So, in essence if you want to restrict what a user can do on your database, simple have your start-up application as the only entry point that is cataloged. &nbsp;Then, the only thing a user can do is execute your application. &nbsp;This is important to understand, as once your&nbsp;</span><font size=\"3\" style=\"color: rgb(51, 51, 51);\">application</font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">&nbsp;starts running, the user is&nbsp;</span><font size=\"3\" style=\"color: rgb(51, 51, 51);\">restricted</font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">&nbsp;to what you allow him or her to do through your application. &nbsp;</span><br><br><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">Note that most the programs written in the JSB_TCL file check for administration privileges. &nbsp;The JSB_TCL program thus allow t</span><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">he administrator to write, edit, delete and compile Basic programs, and execute all TCL commands. He or she is still limited to access only files (SQL tables) defined in the account to which he or she is logged into. &nbsp;And, if you so desire, you can remove the administrator login from your account, and&nbsp;</span><font size=\"3\" style=\"color: rgb(51, 51, 51);\">further</font><font size=\"3\" style=\"color: rgb(51, 51, 51); line-height: 17.6px;\">&nbsp;prevent any modifications to your code or execution of TCL commands. &nbsp;(However, doing so may also prohibit you from changing your Basic code).</font><br><br><b style=\"color: rgb(51, 51, 51); line-height: 17.6px;\"><font size=\"4\">English</font></b><br><br><font size=\"3\"><font color=\"#333333\" style=\"color: rgb(0, 0, 0);\"><span style=\"line-height: 17.6px;\">One group of TCL commands you have available to you as an administrator is called&nbsp;</span></font><i style=\"color: rgb(51, 51, 51); line-height: 17.6px;\">English.</i><font color=\"#333333\" style=\"color: rgb(0, 0, 0);\"><span style=\"line-height: 17.6px;\">&nbsp;English is a simple reporting system that allows you to \"LIST\" or \"SELECT\" the contents of your database. &nbsp;(</span></font><font color=\"#000000\">Similar</font><font color=\"#000000\" style=\"color: rgb(51, 51, 51);\"><span style=\"line-height: 17.6px;\">&nbsp;in concept to a SQL SELECT command ). &nbsp;</span></font><br><br><b style=\"color: rgb(0, 0, 0); line-height: 17.6px;\">Items<br><br></b><font color=\"#000000\" style=\"color: rgb(51, 51, 51);\"><span style=\"line-height: 17.6px;\">At the row-level of an MVDBMS database is the item. &nbsp;Items may be of 3&nbsp;</span></font>fundamental<font color=\"#000000\"><font color=\"#333333\"><span style=\"line-height: 17.6px;\">&nbsp;types. &nbsp;They can be MVDBMS items (containing attributes, values and&nbsp;</span></font>sub-values<font color=\"#333333\"><span style=\"line-height: 17.6px;\">), &nbsp;they can be JSON items, or they can be binary items. &nbsp;Let look at an example of the first two.<br><br>JSON items of a&nbsp;</span></font></font></font><span style=\"color: rgb(51, 51, 51); font-size: medium; line-height: 17.6px;\">MVDBMS&nbsp;file may be listed either in columnar format or in page-form format, Here is an example of columnar format on the single item \"100\" from the file \"customers\".</span></div ></div ></font></h4><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\">\xFE";
