 z+="<span style=\"font-size: 17.5px; line-height: 25px;\"><font face=\"times new roman\">The command used here was the TCL \"LIST\" command. &nbsp;It has the syntax of \"LIST <i>tablename {columnnames} {itemids}</i>\". &nbsp;In this example, the Database we are using is the one we logged into (not shown here). &nbsp;The MVDBMS File (SQL Table) is \"customers\", and the Item is 100 (SQL Row Primary Key). &nbsp;Notice that the email attribute (Sql column) contains <i>values (nested children in an attribute). &nbsp;</i>Since LIST is an English command, it understands how to deal with nested values and sub-values. &nbsp;Let's look at the \"L\" command. &nbsp;The \"L\" command is similar to the LIST command but takes a SQL syntax and returns a columnar list.&nbsp;</font></span>\xFE";
 z+="<span style=\"font-family: &quot;times new roman&quot;; font-size: 15.1181px; line-height: normal;\">Notice that in the columnar format, we see the \"columns\" or \"attributes\" spaced evenly across the page. &nbsp;This formatting and spacing can be changed with additional meta-data (called dictionary items, which we will discuss later). &nbsp;</span>\xFE";
